import React from 'react';
import Pic from '../../asset/image/picture.png';
const About_Us_First = () => {
  return (
    <div>
      <div
        style={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center'
        }}
      >
        <img
          src={Pic}
          alt='Picture'
          style={{
            width: '300px'
          }}
        />
      </div>
    </div>
  );
};

export default About_Us_First;
